import CreateUser_temp from "../User/CreateUser_temp";
import ShowUser_temp from "../User/ShowUser_temp";
import EditUser_temp from "../User/EditUser_temp";
import User_temp from "../User/User_temp";
import Home from "../Layout/Home";

const URLs = {
    home: { link: "/", route: <Home /> },
    edit: { link: "/edit/:id", route: <EditUser_temp /> },
    comment: { link: "/comment/", route: <User_temp /> },
    create: { link: "/create", route: <CreateUser_temp /> },
    list: { link: "/list", route: <ShowUser_temp /> },
};

export default function URLhandler() {
    return URLs;
}
